缓存是统一的，而缓冲区是原始磁盘块，并不代表存在于页面缓存，即不是文件数据。","zhtw":"","zh":"内存缓冲是指内存块的输入输出缓冲。它们是相对短暂存储的。 在 Linux 内核版本 2.4 之前，Linux 具有单独的页面和缓冲区高速缓存。 从 2.4 开始，页面和缓冲区高速缓存是统一的，而缓冲区是原始磁盘块，并不代表存在于页面缓存，即不是文件数据。"},"Memory buffers":{"ja":"メモリバッファ","zhhk":"記憶體緩衝","zhcn":"内存缓冲","zhtw":"記憶體緩衝","zh":"内存缓冲"},"Cached memory is memory that Linux uses for disk caching. However, this doesn\\\\\'t count as \\"used\\" memory, since it will be freed when applications require it. Hence you don\\\\\'t have to worry if a large amount is being used.":{"ja":"","zhhk":"","zhcn":"内存缓存指 Linux 使用的磁盘缓存。不管怎样，这些都不算作“已用”内存，如果程序有需要的话，它们就会被释放并为其所用。所以您不需要担心缓存过大会造成什么问题。","zhtw":"","zh":"内存缓存指 Linux 使用的磁盘缓存。不管怎样，这些都不算作“已用”内存，如果程序有需要的话，它们就会被释放并为其所用。所以您不需要担心缓存过大会造成什么问题。"},"Memory cached":{"ja":"メモリキャッシュ","zhhk":"記憶體快取","zhcn":"内存缓存","zhtw":"記憶體快取","zh":"内存缓存"},"Linux comes with many commands to check memory usage. The \\"free\\" command usually displays the total amount of free and used physical and swap memory in the system, as well as the buffers used by the kernel. The \\"top\\" command provides a dynamic real-time view of a running system.":{"ja":"","zhhk":"","zhcn":"Linux 有许多命令来查看内存使用量。命令“free”通常用于显示系统可用的物理内存和交换分区内存，以及内核所占用的缓存。“top”命令提供系统正在运行的实时视图。","zhtw":"","zh":"Linux 有许多命令来查看内存使用量。命令“free”通常用于显示系统可用的物理内存和交换分区内存，以及内核所占用的缓存。“top”命令提供系统正在运行的实时视图。"},"Memory real usage":{"ja":"実メモリ使用量","zhhk":"真實記憶體使用","zhcn":"真实内存占用","zhtw":"真實記憶體使用","zh":"真实内存占用"},"Swap cached":{"ja":"SWAP キャッシュ","zhhk":"SWAP 快取","zhcn":"SWAP 缓存","zhtw":"SWAP 快取","zh":"SWAP 缓存"},"Swap usage":{"ja":"SWAP 使用量","zhhk":"SWAP 使用","zhcn":"SWAP 占用","zhtw":"SWAP 使用","zh":"SWAP 占用"},"${minute} minute average":{"ja":"${minute} 分ごとの平均負荷","zhhk":"${minute}  分鐘平均負載","zhcn":"${minute} 分钟平均负载","zhtw":"${minute} 分鐘平均負載","zh":"${minute} 分钟平均负载"},"System load":{"ja":"システム負荷","zhhk":"系統負載","zhcn":"系统负载","zhtw":"系統負載","zh":"系统负载"},"Server Status":{"ja":"サーバーの状態","zhhk":"伺服器狀態","zhcn":"服务器状态","zhtw":"伺服器狀態","zh":"服务器状态"},"Status":{"ja":"状態","zhhk":"狀態","zhcn":"状态","zhtw":"狀